/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Component } from 'react'
import { BrowserRouter as Router,Link, Route, Switch } from 'react-router-dom'
import Reg from '../Register/Reg'
import './InputLogin.css'

export default class InputLogin extends Component {
    constructor(props) {
        super(props)
        this.state ={
          username: "",
          password: ""
        };
      }

    componentDidCatch(){
        fetch('https://randomuser.me/api/')
            .then(res => res.json())
            .then(res => this.setState({ username: res}))
    }

    render() {
        return (
            <Router>
            <div className="row">

                    <div>
                        (json.stringify)
                    </div>

                    <div className="col">

                    <form action="" >

                        <div className="form-group">
                            <label >Email</label>
                            <input 
                            onChange={e => {this.setState({username: e.target.value})}}
                            value={this.state.email} 
                            type="email"
                            name="username" 
                            className="form-control" 
                            placeholder="Email" />

                            <label>Password</label>
                            <input 
                            onChange={e => {this.setState({password: e.target.value})}}
                            value={this.state.password} 
                            type="password"
                            name="password" 
                            className="form-control" 
                            placeholder="Password" />

                            <button type="submit">เข้าสู่ระบบ</button>
                            <Link to={'/Register/Reg'} className="nav-link"> สมัครสมาชิก </Link>
                        <hr />
                        <Switch>
                            <Route path='/Register/Reg' component={Reg} />
                        </Switch>

                        </div>


                    </form>
                    </div>

            </div>
            </Router>

        )
    }
}
